import React, { Component} from 'react';
import Api from './Api';
import $ from 'jquery';
import data from "../data"; 
class home extends Component{
	
	 render(){
		return (
		
			    <div>
      <Button />
      <Button />
    </div>
		);
    }
}

const Button = () => {
  const handleClick = () => console.log('Clicked!');
  return (
    <button type="button" onClick={handleClick}>
      Click me!
    </button>
  );
};

export default home;
